        public void WriteIssuesToFile(List<InterAgencyFieldMapping> data)
        {
            using (var fileStream = new FileStream("C:\\Temp\\AFHSBEntries.txt", FileMode.Append))
            {
                using (var strmWrtr = new StreamWriter(fileStream))
                {
                    foreach (var item in data)
                    {
                        if(item.AfhscFieldLength > item.EpiDataCenterFieldLength)
                        {
                            strmWrtr.WriteLine(item.EpiDataCenter + "\t" + item.EpiDataCenterFieldLength + "\t" + item.AFHSC + "\t" + item.AfhscFieldLength);
                        }
                    }
                }
            }
        }
    }
